    "blackwater-national-wildlife-refuge-quarterly-narrative-report-august-september-october-19",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Blackwater NWR
    outlines Refuge accomplishments from August through October of 1941. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including waterbirds, upland game birds, furbearers, predators, rodents,
    and mammals- is also covered. The Refuge development and maintenance section discusses
    physical developments and plantings. Resource management is outlined; topics include
    cooperative farming. The public relations section of the report describes recreational
    uses, Refuge visitors, and violations.",nt"license_title": "License Not Specified",nt"extras":
